import ResultListItem from './ResultListItem';

const ResultList = () => {
  const results = [
    {
      _id:              'Team een',
      score:            24,
      questionsCorrect: 11,
    },
    {
      _id:              'Team twee',
      score:            18,
      questionsCorrect: 7,
    },
    {
      _id:              'Team drie',
      score:            16,
      questionsCorrect: 6,
    },
  ];

  return (
    <div className="m-result my-10">
      <h3 className="mb-0">Scoreboard</h3>
      <ul className="m-result__list">
        <div className="m-result__item">
          <span className="m-result__part m-result__name"><b>Naam</b></span>
          <span className="m-result__part m-result__score"><b>Totale score</b></span>
          <span className="m-result__part m-result__amount-correct"><b>Aantal vragen goed</b></span>
        </div>
        {results.map(({ _id, score, questionsCorrect }) => (
          <ResultListItem key={_id} name={_id} score={score} questionsCorrect={questionsCorrect}/>
        ))}
      </ul>
    </div>
  );
};

export default ResultList;
